script: |
  super -f text -I q1616.spq | sort > q1616.out

inputs:
  - name: q1616.spq
    data: |
      SELECT col2 + - CAST ( + col1 AS INTEGER ) AS col1 FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT col1 + col2 NOT BETWEEN NULL AND - 45 / 14;
  - name: tab0

outputs:
  - name: q1616.out
    data: |
